import React from 'react';
import Card from './Card';


function loadImage() {
	return pets[i].img;
}

function CardList({ pets, images }) {
	return (
		<div>
			{
				pets.map((pet, i) => {
					return <Card key={pets[i].id} 
						img={this.loadImage()} 
						name={pets[i].name} 
						description={pets[i].description} />
					})
			}
		</div>
	);
}

export default CardList;
